    public FarmHashTests()
    {
        unchecked
        {
            ulong a = 9;
            ulong b = 777;
            for (int i = 0; i < DataSize; i++)
            {
                a += b;
                b += a;
                a = (a ^ (a >> 41)) * FarmHashConstants.K0;
                b = (b ^ (b >> 41)) * FarmHashConstants.K0 + (ulong)i;
                byte u = (byte)(b >> 37);
                _data[i] = u;
            }
        }
    }

    private uint CreateSeed(int offset, int salt)
    {
        unchecked
        {
            uint h = (uint)(salt & 0xffffffff);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            h += (uint)(offset & 0xffffffff);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            h *= FarmHashConstants.C1;
            h ^= (h >> 17);
            return h;
        }
    }

    [Fact]
    public unsafe void FarmHash32Test()
    {
        fixed (byte* data = _data)
        {
            int i = 0;
            for (; i < TestSize - 1; i++)
            {
                int offset = i * i;
                int len = i;
                int index = i * 10;

                uint seed = CreateSeed(offset, -1);

                Assert.Equal(_expected[index], FarmHash32Unsafe.ComputeHash(data + offset, len, seed));
                Assert.Equal(_expected[index], FarmHash32.ComputeHash(_data.AsSpan(offset, len), seed));
                Assert.Equal(_expected[index + 1], FarmHash32Unsafe.ComputeHash(data + offset, len));
                Assert.Equal(_expected[index + 1], FarmHash32.ComputeHash(_data.AsSpan(offset, len)));
            }
        }
    }
